import React from "react";

const AnswerButs = props => {
  return (
    <>
      <div className="ui cards">
        <div className="card">
          <div className="content">
            <div className="meta">
              <div className="ui four column grid">
                <div className="row">
                  <div className="column">
                    <button
                      className="ui button"
                      id="but0"
                      onClick={e => alert(e.target.id)}
                    >
                      {props.mixedAnswers[0]}
                    </button>
                  </div>
                  <div className="column">
                    <button className="ui button" id="but1">
                      {props.mixedAnswers[1]}
                    </button>
                  </div>
                </div>
                <div className="column">
                  <button className="ui button" id="but2">
                    {props.mixedAnswers[2]}
                  </button>
                </div>
                <div className="column">
                  <button className="ui button" id="but3">
                    {props.mixedAnswers[3]}
                  </button>
                </div>
              </div>
            </div>
            <div className="description" />
            {props.QuestionFromAPI}
          </div>
        </div>
      </div>
    </>
  );
};

export default AnswerButs;
